import React from 'react';
import PhotoUpload from './PhotoUpload'; 
function Create_form() {
  return (
    <section className="blog">
      <div className="blog-header">
        <img className="ava" src="/img/logo.jpeg" alt="Blogger Avatar" />
        <h4 className="blog-name">Danial Abibulla</h4>
        <button className="delete">
          <img src="/img/delete.png" alt="Delete Blog" />
        </button>
      </div>
      <form className="blog-content">
        <input type="text" placeholder="Что хотите писать?" />
        <PhotoUpload />
        <button>Создать блог</button>
      </form>
    </section>
  );
}

export default Create_form;
